        <View style={styles.container}>
            <StatusBar backgroundColor={'#edf0f5'}/>
            <Text style={styles.judul}>Discover Book</Text>
            <FlatList>

            </FlatList>
        </View>
    );
}

const styles = StyleSheet.create({
    buku : {
        width : '100%',
        height : 50,
        backgroundColor : 'white',
        borderRadius: 10,
    },
    container : {
        paddingTop: 70,
        paddingHorizontal: 20,
        backgroundColor : '#edf0f5',
        flex: 1
